import { Row } from 'antd';
import StoreListItem from '../store-list-item'
import Spinner from '../spinner/spinner';
import { WithStoreService } from '../hoc';
import { useQuery } from 'react-query';
import { Product } from '../../interfaces';
import StoreService from '../../services/store-service';

interface StoreListProps {
  storeService: any
}

const StoreList = ({ storeService }: StoreListProps): JSX.Element => {

  const { isLoading, error, data: products } = useQuery<Product[]>('products', storeService.getProducts)


  if (isLoading) {
    return <Spinner />
  }
  if (error) {
    return 
  }

  return (
    <div className="site-card-wrapper">
      <Row gutter={[26, 26]}>
        {
          products && products.map(product => {

            return (
              <StoreListItem key={product.id} product={product} />
            )
          })
        }
      </Row>
    </div>
  )
}



export default WithStoreService()(StoreList)
